INSERT INTO `cache_filter` VALUES ('1:2044c7db324648798679d13d68381fc5','<p>LaLa\'s Lemonade is coming soon to a Torchy\'s Tacos near you!</p>\n<p>We use fresh squeezed, flash pasteurized, lemon juice and we add real fruit puree - our current flavors are below:</p>\n<p>OLD FASHIONED * STRAWBERRY * BLACKBERRY * BLUEBERRY * RASPBERRY * PINEAPPLE-MANGO * PEACH</p>\n<p>We now also offer our lemonade in half gallons to go -<br />\nplease call us for special orders. </p>\n<p>Follow us on Twitter!</p>\n<p><a href=\"http://twitter.com/LalasLemonade\" title=\"http://twitter.com/LalasLemonade\">http://twitter.com/LalasLemonade</a></p>\n<p> Go to fullsize image  </p>\n<p>Please visit us at the following Farmers\' Markets and Festivals... </p>\n<p>Barton Creek Farmers\' Market     Saturdays     9:00 am - 1:00 pm</p>\n<p>Fair Trade Film Festival - Alamo Drafthouse South - May 8th</p>\n',1274500516,1274414116,'',0),('2:2500a28747f7474e43fd617cde89714b','<p><img src=\'http://local.e2thex.org/lala/sites/default/files/lala_logo-100.jpg\' /></p>\n',1274500855,1274414455,'',0),('2:c1bcc2a405767681d2d89f27e29c9523','<p><img src=\'http://local.e2thex.org/lala/sites/default/files/lala_logo-165.jpg\' /></p>\n',1274501702,1274415302,'',0),('1:b78fbf7500c931e076b362ab946ecd63','<p><a href=\'http://www.torchystacos.com/\'></a><br />\n<a></a></p>\n',1274502211,1274415811,'',0),('2:b78fbf7500c931e076b362ab946ecd63','<p><a href = \'http://www.torchystacos.com/\'><img src =\'http://local.e2thex.org/lala/sites/default/files/Torchys_Tacos_Logo-165.png\' /></a><br />\n<a href = \'Barton Creek Farmers Market\'\'><img src =\'http://local.e2thex.org/lala/sites/default/files/barton_creek-165.gif\' /></a></p>\n',1274502258,1274415858,'',0),('2:d5d66a98cef5d06b4fe7315ab7800d65','<p><a href = \'http://www.torchystacos.com/\'><img src =\'http://local.e2thex.org/lala/sites/default/files/Torchys_Tacos_Logo-165.png\' /></a><br />\n<br />\n<a href = \'Barton Creek Farmers Market\'\'><img src =\'http://local.e2