INSERT INTO `node_revisions` VALUES (1,1,1,'Home','<div style=\"float:right;border:dotted 1px #AFCCD0;padding:10px\">\r\n<h2>Flavors</h2>\r\nOLD FASHIONED  \r\nSTRAWBERRY  \r\nBLACKBERRY  \r\nBLUEBERRY  \r\nRASPBERRY \r\nPINEAPPLE-MANGO \r\nPEACH\r\nLAVENDER\r\n</div>\r\nWe use fresh squeezed, flash pasteurized lemon juice and real fruit puree. Made daily in South Austin. All local. All natural. All the time.\r\n\r\nWe now also offer our lemonade in half gallons to go -\r\nplease call us for special orders. \r\n\r\n','<div style=\"float:right;border:dotted 1px #AFCCD0;padding:10px\">\r\n<h2>Flavors</h2>\r\nOLD FASHIONED  \r\nSTRAWBERRY  \r\nBLACKBERRY  \r\nBLUEBERRY  \r\nRASPBERRY \r\nPINEAPPLE-MANGO \r\nPEACH\r\nLAVENDER\r\n</div>\r\nWe use fresh squeezed, flash pasteurized lemon juice and real fruit puree. Made daily in South Austin. All local. All natural. All the time.\r\n\r\nWe now also offer our lemonade in half gallons to go -\r\nplease call us for special orders. \r\n\r\n','',1274417603,2),(4,4,1,'Flavors','<h2>OLD FASHIONED</h2> \r\nThis is the base for all of the flavored lemonades.  Sometimes you Just want the classic.  Tangy and sweet, it is good as base, and great by itself\r\n<h2>STRAWBERRY</h2>\r\n<h2>BLACKBERRY</h2>\r\n<h2>BLUEBERRY</h2>\r\n<h2>RASPBERRY </h2>\r\n<h2>PINEAPPLE-MANGO</h2> \r\n<h2>PEACH</h2>','<h2>OLD FASHIONED</h2> \r\nThis is the base for all of the flavored lemonades.  Sometimes you Just want the classic.  Tangy and sweet, it is good as base, and great by itself\r\n<h2>STRAWBERRY</h2>\r\n<h2>BLACKBERRY</h2>\r\n<h2>BLUEBERRY</h2>\r\n<h2>RASPBERRY </h2>\r\n<h2>PINEAPPLE-MANGO</h2> \r\n<h2>PEACH</h2>','',1274418369,2),(2,2,1,'logo','<img src=\'/lala/sites/default/files/lala_logo-165.jpg\' style=\'position:relative;top:-30px;margin-bottom:-60px;\'>','<img src=\'/lala/sites/default/files/lala_logo-165.jpg\' style=\'position:relative;top:-30px;margin-bottom:-60px;\'>','',1274419813,2),(3,3,1,'Avaiable At:','<a href = \'http://www.torchystacos.com/\'><img src =\'/lala/sites/default/files/Torchys_Tacos_Logo-100.png\'></a><a href = \'Barton Creek Farmers Market\'\' style=\"float:right\"><img src =\'/lala/sites/default/files/barton_creek-265.gif\'></a>\r\n\r\n','<a href = \'http://www.torchystacos.com/\'><img src =\'/lala/sites/default/files/Torchys_Tacos_Logo-100.png\'></a><a href = \'Barton Creek Farmers Market\'\' style=\"float:right\"><img src =\'/lala/sites/default/files/barton_creek-265.gif\'></a>\r\n\r\n','',1274419244,2),(5,5,1,'Follow us','<a href =\'http://twitter.com/LalasLemonade\'><img src = \'http://local.e2thex.org/lala/sites/default/files/Twitter logo-20.jpg\'> Follow us on Twitter</a>\r\n<a href =\'http://twitter.com/LalasLemonade\'><img src = \'http://local.e2thex.org/lala/sites/default/files/facebook-logo-20.png\'\'> FInd us on Facebook</a>\r\n','<a href =\'http://twitter.com/LalasLemonade\'><img src = \'http://local.e2thex.org/lala/sites/default/files/Twitter logo-20.jpg\'> Follow us on Twitter</a>\r\n<a href =\'http://twitter.com/LalasLemonade\'><img src = \'http://local.e2thex.org/lala/sites/default/files/facebook-logo-20.png\'\'> FInd us on Facebook</a>\r\n','',1274419580,2),(6,6,1,'Meet LaLa','','','',1274418587,1),(7,7,1,'Events','','','',1274418619,1),(8,8,1,'Contact Us','','','',1274418642,1);
